import { MenuEntry } from '@pancakeswap-libs/uikit'

const config: MenuEntry[] = [
  {
    label: 'Home',
    icon: 'HomeIcon',
    href: '/',
  },


      {
        label: 'Exchange',
           icon: 'TradeIcon',
            items: [

      {
        label: 'Exchange',
        href: 'https://jewelswap.finance/#/swap',
      },
      {
        label: 'Liquidity',
        href: 'https://jewelswap.finance/#/pool',
      },
        ]
      },
                                { 
        label: 'Farms',
        icon: 'FarmIcon',
        href: '/farms',
      },
  {        label: 'Info',
             icon: 'InfoIcon',
              items: [
              {
        label: 'Github',
        href: 'https://github.com/jewelswap',
      },
        {
        label: 'Contract',
        href: 'https://bscscan.com/address/0x25bF3bc808c373918CCfB1e5Ef8661ffc7182D54#code',
      },
              { 
        label: 'Liquidity',
        href: 'https://bscscan.com/address/0xE3e30491956b0e51170DB5d35582b6b14760AAD9',
      },
                    { 
        label: 'WhitePaper',
        href: 'https://github.com/JewelSwap/BluePaper/blob/main/BluePaper.pdf',
      },
      ]},
]

export default config
